class Detector:
	def __init__(self):
		os.environ["TFHUB_CACHE_DIR"] = r'C:\Users\George\Desktop\Programming\Freelance\AI-Public-API\ai_models'
		self.accepted_extensions = ['.jpg', '.jpeg']
		print(self.check_extension("prikol.jpeg"))
		self.MODEL_DIR = "../ai_models"
		self.IMAGE_CACHE_DIR = "../cache"
		self.detector = hub.load("https://tfhub.dev/google/faster_rcnn/openimages_v4/inception_resnet_v2/1").signatures['default']
		#self.detector = tf.saved_model.load(f"{self.MODEL_DIR}", tags=None, options=None)
		self.json_pattern = {"status": None, "message": None, "payload": {}}
		
	def check_extension(self, filename):
		extension = os.path.splitext(filename)[1]
		print(extension, self.accepted_extensions)
		if extension in self.accepted_extensions:
			return True

	def get_extension(self, filename):
		return os.path.splitext(filename)[1]

	def load_img(self, path):
		img = tf.io.read_file(path)
		img = tf.image.decode_jpeg(img, channels=3)
		return img

	def form_response(self, status, message, payload):
		response = self.json_pattern.copy()
		response["status"] = status
		response["message"] = message
		response["payload"] = payload
		return status, json.dumps(response)

	def decodeImg(self, base64code, filename):
		CACHE_FILENAME = f"{sha256(base64code.encode('utf-8')).hexdigest()}{self.get_extension(filename)}"
		filename = f'{self.IMAGE_CACHE_DIR}/{CACHE_FILENAME}'
		with open(filename, "wb") as file:
			file.write(decodebytes(base64code.encode('utf-8')))
		pil_image = Image.open(os.path.abspath(filename))
		pil_image = ImageOps.fit(pil_image, (256, 256), Image.ANTIALIAS)
		pil_image_rgb = pil_image.convert("RGB")
		pil_image_rgb.save(os.path.abspath(filename), format="JPEG", quality=90)
		print("Image saved to to %s." % filename)
		return filename
	
	def run(self, base64code, filename):
		if not self.check_extension(filename):
			return self.form_response(400, "invalid_file_extension", {})
		else:
			try:
				start_time = time.time()
				image_path = self.decodeImg(base64code, filename)
				img = self.load_img(image_path)
				converted_img  = tf.image.convert_image_dtype(img, tf.float32)[tf.newaxis, ...]
				result = self.detector(converted_img)
				result = {key:value.numpy() for key,value in result.items()}
				end_time = time.time()
				print("Found %d objects." % len(result["detection_scores"]))
				print("Inference time: ", end_time-start_time)
				payload = {}
				payload["detection_objects"] = {}
				total = 0
				for i in range(len(result["detection_scores"])):
					detected = result["detection_class_entities"][i].decode("ascii")
					score = round(100 * result["detection_scores"][i], 3)
					if score > 10:
						total += 1
						display_str = "{}: {}%".format(detected,score)
						print(display_str)
						if detected in payload["detection_objects"].keys():
							payload["detection_objects"][detected].append(score)
						else:
							payload["detection_objects"][detected] = []
							payload["detection_objects"][detected].append(score)
				payload["detection_total"] = total

				return self.form_response(200, "success", payload)
			except Exception as e:
				print(e)
				return self.form_response(500, f"server_error", {})

AIDetector = Detector()
k = AIDetector.run("", "prikol.jpg")
